nd temporal resolutions. Quality-assured monthly updates of ERA5 (1979 to present) are published within 3 months of real time. Preliminary daily updates of the dataset are available to users within 5 days of real time. ERA5 combines vast amounts of historical observations into global estimates using advanced modelling and data assimilation systems. ERA5 replaces the ERA-Interim reanalysis which stopped being produced on 31 August 2019. You can read about the key characteristics of ERA5 and important changes relative to ERA-Interim."},"id":"3997","type":"panel.models.markup.HTML"},{"attributes":{},"id":"3800","type":"WheelZoomTool"},{"attributes":{"callback":null,"renderers":[{"id":"3842"}],"tags":["hv_created"],"tooltips":null},"id":"3778","type":"HoverTool"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"3803","type":"BoxAnnotation"},{"attributes":{"height":0,"margin":[0,0,0,0],"name":"Spacer09856","sizing_mode":"stretch_width"},"id":"3769","type":"Spacer"},{"attributes":{"children":[{"id":"3996"},{"id":"3997"}],"margin":[0,0,0,0],"name":"Row09903","sizing_mode":"stretch_width"},"id":"3995","type":"Row"},{"attributes":{"children":[{"id":"3973"},{"id":"3974"}],"margin":[0,0,0,0],"name":"Row09866","sizing_mode":"stretch_width"},"id":"3972","type":"Row"},{"attributes":{"high":312.4548034667969,"low":215.31121826171875,"nan_color":"rgba(0, 0, 0, 0)","palette":["#053061","#063263","#073466","#083669","#09386c","#0a3a6f","#0b3c72","#0c3e75","#0d4078","#0e437b","#0f457e","#114781","#124984","#134b87","#144d8a","#154f8d","#165190","#175493","#185695","#195898","#1a5a9b","#1c5c9e","#1d5ea1","#1e60a4","#1f62a7","#2064aa","#2166ac","#2368ad","#246aae","#256caf","#276db0","#286fb0","#2971b1","#2b73b2","#2c75b3","#2d76b4","#2f78b5","#307ab6","#317cb7","#337db8","#347fb empty\n  var metadata = msg.metadata;\n  var comm_id = metadata.comm_id\n  var comm_status = window.PyViz.comm_status[comm_id];\n  if (comm_status.event_buffer.length) {\n    process_events(comm_status);\n    comm_status.blocked = true;\n    comm_status.time = Date.now()+20;\n  } else {\n    comm_status.blocked = false;\n  }\n  comm_status.event_buffer = [];\n  if ((metadata.msg_type == \"Ready\") &amp;&amp; metadata.content) {\n    console.log(\"Python callback returned following output:\", metadata.content);\n  } else if (metadata.msg_type == \"Error\") {\n    console.log(\"Python failed with the following traceback:\", metadata.traceback)\n  }\n}\n\n// Initialize Comm\nif ((window.PyViz == undefined) || (window.PyViz.comm_manager == undefined)) { return }\nvar comm = window.PyViz.comm_manager.get_client_comm(\"3768\", \"a3d25063eeef4f768750bec58518ecd8\", on_msg);\nif (!comm) {\n  return\n}\n\n// Initialize event queue and timeouts for Comm\nvar comm_status = window.PyViz.comm_status[\"a3d25063eeef4f768750bec58518ecd8\"];\nif (comm_status === undefined) {\n  comm_status = {event_buffer: [], blocked: false, time: Date.now()}\n  window.PyViz.comm_status[\"a3d25063eeef4f768750bec58518ecd8\"] = comm_status\n}\n\n// Add current event to queue and process queue if not blocked\nvar event_name = cb_obj.event_name;\nif (event_name === undefined) {\n  // we are a widget not an event... fake a key.\n  event_name = Object.keys(data).join(',');\n}\ndata['comm_id'] = \"a3d25063eeef4f768750bec58518ecd8\";\nvar timeout = comm_status.time + 20000;\nif ((comm_status.blocked &amp;&amp; (Date.now() &lt; timeout))) {\n  comm_status.event_buffer.unshift([event_name, data]);\n} else {\n  comm_status.event_buffer.unshift([event_name, data]);\n  setTimeout(function() { process_events(comm_status); }, 20);\n  comm_status.blocked = true;\n  comm_status.time = Date.now()+20;\n}\n"},"id":"3835","type":"CustomJS"},{"attributes":{"margin":[5,5,5,5],"name":"HTML09888","sizing_mode":"stretch_wid
